import React from 'react';
import "../Featured-wedding/FeaturedWedding.css";
import featuredimg1 from "../images/featured-img/featured1.jpg";

function FeaturedWedding() {
  return (
    <>
    <div class="container">
  <div class="row">
    <div class="col-md-12">
      <div class="card-deck d-flex">
        <div class="card w-25">
          <img src={featuredimg1} class="card-img-top" alt="..." />
          <div class="card-body">
            <h5 class="card-title">Card 1 Heading</h5>
            <p class="card-text">Card 1 Paragraph</p>
          </div>
        </div>
        <div class="card w-25">
          <img src={featuredimg1} class="card-img-top" alt="..." />
          <div class="card-body">
            <h5 class="card-title">Card 1 Heading</h5>
            <p class="card-text">Card 1 Paragraph</p>
          </div>
        </div>
        {/* <!-- Repeat the above two card elements 8 more times --> */}
      </div>
    </div>
  </div>
</div>

    </>
  );
}

export default FeaturedWedding;
